lign:center\\\"><span style=\\\"font-size:1em\\\">إِنْ أَمُتْ أَوْ كُنْتُ حَيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                      لا لِـوا إِلَّا لِـواكْ.</span></p>\\n\\n<p style=\\\"text-align:center\\\"> </p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">--------------------------------</span></p>\\n\\n<p style=\\\"text-align:center\\\"> </p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">أَرْزَتي بُـثِّي إِلَيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                    سِرَّ أَمْجادِ الأُمَمْ   </span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">تَجِدي مِنّي وَفِيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                   هِمَمًا فَوْقَ الهِمَمْ.</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">يا فَتى الأَرْزِ تَهَيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                       وَاخْتطِفْ حُرِّيَّتَكْ</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">وَانْهَجِ النَّهْجَ السَّوِيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                       واحْتَـرِمْ ذَرِّيَّتَكْ!</span></p>\\n\\n<p style=\\\"text-align:center\\\"> </p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">-------------------------------</span></p>\\n\\n<p style=\\\"text-align:center\\\"> </p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">لاَ تَكُنْ عَبْداً زَرْيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                     مُثْقَلَ العُنْقِ ذَليلْ</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">بَلْ فَتىً حرًّا أَبِيًّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                     شَامِخَ الأَنْفِ نَبيلْ</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">وَطَني الغالِي عَلَيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                     نَهْضَةً قَبْلَ الفَواتْ</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">تُرْجِعُ الكَهْلَ فَتِيَّا</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">                     بَيْنَ طُلّابِ الحَياةْ!</span></p>\\n\\n<p style=\\\"text-align:center\\\"><span style=\\\"font-size:1em\\\">               </span></p>\\n\\n<p><span style=\\\"font-size:1em\\\"><span>  رشيد نخلة / كتابُ القراءةِ - الصّفُّ الرّابعُ                                        </span></span></p>\\n\\n<p> </p>\\n\\n<p style=\\\"text-align:right\\\"><strong>:شَرْحُ المفرداتِ</strong></p>\\n\\n<p style=\\\"text-align:right\\\">                           قبلَ الفواتِ: قبلَ مضيِّ الوقتِ -</p>\\n\\n<p style=\\\"text-align:right\\\">الكهلُ: المتقدّمُ في السّنِّ -</p>\\n\\n<p style=\\\"text-align:right\\\">صفيًّا: صديقًا مخلصًا -</p>\\n\\n<p style=\\\"text-align:right\\\">بثّي إليَّ: أخبريني -</p>\\n\\n<p style=\\\"text-align:right\\\">الهممُ: العزائمُ -</p>\\n\\n<p style=\\\"text-align:right\\\"> تهيّا: استعدَّ -</p>\\n\\n<p style=\\\"text-align:right\\\">النّهجَ السّويَ: الطّريقَ المستقيمَ -</p>\\n\\n<p style=\\\"text-align:right\\\">زريًّا: محتقرًا -</p>\\n\\n<p style=\\\"text-align:right\\\">الأبيُّ: الّذي يرفضُ الذّلَّ -</p>\\n\\n<p style=\\\"text-align:right\\\"><strong>:خطواتُ توثيقِ نصٍّ</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>أوّلًا:</strong> أُحدّدُ العنوانَ الموجودَ أعلى النّصِّ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>ثانيًا:</strong> أحدّدُ اسمَ الكاتبِ الموجودِ أسفلَ النّصِّ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>ثالثًا:</strong> أحدّدُ المصدرَ الّذي أُخِذَ منهُ النّصّ إنْ وُجدَ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\">.<strong>رابعًا:</strong> أُحدّدُ تاريخَ النّشرِ إنْ وجدَ <strong>-</strong></p>\\n\\n<p style=\\\"text-align:right\\\"><span><span><span>    </span></span></span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1b6d4df8-7b07-4c19-8337-7dd0a0876e1a\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.375em\\\">  .٣- حدّدْ عنوانَ النّصِّ بالضّغطِ على الإجابةِ الصّحيحةِ</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9ee5f106-bfc6-4771-9dbd-cfe68a715462\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"imageHotspotQuestion\":{\"hotspotSettings\":{\"hotspot\":[{\"userSettings\":{\"correct\":true,\"feedbackText\":\"إجابةٌ صحيحةٌ\"},\"computedSettings\":{\"x\":3.6005760921747476,\"y\":10.095911155981828,\"width\":32.405184829572725,\"height\":80.76728924785462,\"figure\":\"rectangle\"}}],\"showFeedbackAsPopup\":true,\"l10n\":{\"retryText\":\"Retry\",\"closeText\":\"Close\"}},\"backgroundImageSettings\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABqMAAADKCAMAAAFh+/r1AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAA5UExURQAAAO3t7TAwMH9/f83NzaioqBAQEGJiYo2Njdvb27W1tUJCQiEhIQCG/3FxcQAAAMHBwZubm1FRUV6NZoYAAAABdFJOUwBA5thmAAAACXBIWXMAABcRAAAXEQHKJvM/AAAtkUlEQVR4Xu2di7qrqg6Fz+z9tqdt3/9hTxICImhEy2ztcvzf3mtaUYQwQgBt/Z/jv38LX6uffwrU6nsItXq5XpxBlUwqgFrZoFaDoFYGK61V08ifrfsjRJsRWa22+neUjf59GrU655ftL4YwWqsH/U+Xa/O4lNXKH8R/b25TETtleRzl38FaEe4Uqp6SZdEyWiuGzt8Eyw9lFmrFB+x9MYnzTjdoZ0C26ci2kHLeYCkosZEj+H/d9PnmlNZKMlNIMfFHJa7V5cobyoZ2cIv/XKmZmrhqlBDLlD4OlYJOJJFEl/UXaPfEWLWiMzi3Rkqjuzx5fr5Wv/Lp5+ekfycxVCtCL8yXlb/Pp2xKWspIrcg+Xdpc0vx8rdx+ \":\"U\",\"title\":\"توثيق النّصّ\",\"authors\":[],\"changes\":[],\"extraTitle\":\"توثيق النّصّ\"},\"subContentId\":\"6491e6f5-5614-4da9-8aef-0df364bc9522\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.375em\\\">  .٦- في مضمونِ النّصِّ</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"703586d7-f2fa-4ef5-994c-396ef8fa4ead\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"choices\":[{\"subContentId\":\"744d1b50-0037-4d00-b44a-dde98dca9ef7\",\"question\":\"<p style=\\\"text-align:right\\\">أ- إلامَ يدعو الشّاعرُ وطنَهُ الغالي؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.يدعو الشّاعرُ وطنَهُ للنّهضةِ قبلَ فواتِ الأوانِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.يدعو الشّاعرُ وطنَهُ للمحبّةِ والسّلامِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.يدعو الشّاعرُ وطنَهُ لتشجيعِ المهاجرينَ على العودةِ</p>\\n\"]},{\"subContentId\":\"0d3842ee-ab24-4cd4-820a-52c49cf83917\",\"question\":\"<p style=\\\"text-align:right\\\"> ب- منْ يساعدُ الأوطانَ في نهضتِها؟  </p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.أبناءُ الوطنِ همْ منْ ينهضونَ بهِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الوطنُ ينهضُ بنفسهِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الدّولُ الأخرى المحيطةُ بالوطنِ هيَ منْ تنهضُ بِهِ</p>\\n\"]},{\"subContentId\":\"fccd590a-5679-496f-9374-adfaaf8b98ed\",\"question\":\"<p style=\\\"text-align:right\\\">ج- ماذا يعني الشّاعرُ بالبيتِ \\\"تُرْجِعُ الكَهْلَ فَتِيَّا بَيْنَ طُلّابِ الحَياةْ\\\"؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.الحياةُ تمنحُ الكبارَ فرصةً للشّبابِ والنّشاطِ منْ جديدٍ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الشّاعرُ يشجّعُ الكبارَ على استعادةِ شبابِهم وحيويّتِهم</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الشّاعرُ يدعو الكبارَ للمشاركةِ معَ الشّبابِ في تحقيقِ طموحاتِهم</p>\\n\"]},{\"subContentId\":\"2e1183de-9602-48ae-8739-27498f1345b1\",\"question\":\"<p style=\\\"text-align:right\\\">د- ماذا تثيرُ أخبارُ الأممِ في الشّاعرِ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.أخبارُ الأممِ تثيرُ العزيمةَ والهمّةَ في نفسِ الشّاعرِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.أخبارُ الأممِ تثيرُ الدّهشةَ والاستغرابَ في نفسِ الشّاعرِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.أخبارُ الأممِ تثيرُ الاشمئزازَ في نفسِ الشّاعرِ</p>\\n\"]},{\"subContentId\":\"5ee827d1-c914-49b6-80d8-394c0f203fd7\",\"question\":\"<p style=\\\"text-align:right\\\">ه- ما هوَ المعنى المقصود بالبيتِ \\\"لاَ تَكُنْ عَبْداً زَرْيَّا مُثْقَلَ العُنْقِ ذَليلْ\\\"؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">&nbsp;.الشّاعرُ ينتقدُ الهيمنةَ والاستعبادَ ويدعو للكرامةِ والاستقلالِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الشّاعرُ يدعو في هذا البيتِ إلى حبِّ الوطنِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الشّاعرُ يدعو في هذا البيتِ إلى التّعاونِ بينَ أبناءِ الوطنِ</p>\\n\"]},{\"subContentId\":\"c601bffb-a8de-4b59-bb45-9206f4bf7084\",\"question\":\"<p style=\\\"text-align:right\\\">و- ما هي الرّسالةُ الّتي تحملُها هذهِ القصيدةُ؟</p>\\n\",\"answers\":[\"<p style=\\\"text-align: right;\\\">.الرّسالةُ هيَ رسالةٌ وطنيّةٌ تؤكّدُ على حبِّ الوطنِ والتّضحيةِ منْ أجلِهِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الرّسالةُ هي رسالةٌ سياسيّةٌ تدعو المسؤولينَ فقطْ إلى النّهضةِ بالوطنِ</p>\\n\",\"<p style=\\\"text-align: right;\\\">.الرّسالةُ هيَ دعوةُ أبناءَ الوطنِ المهاجرينَ للعودةِ إلى أرضِ الوطنِ</p>\\n\"]}],\"overallFeedback\":[{\"from\":0,\"to\":100}],\"behaviour\":{\"autoContinue\":true,\"timeoutCorrect\":2000,\"timeoutWrong\":3000,\"soundEffectsEnabled\":true,\"enableRetry\":true,\"enableSolutionsButton\":true,\"passPercentage\":100},\"l10n\":{\"nextButtonLabel\":\"Next question\",\"showSolutionButtonLabel\":\"أظهر الحلّ\",\"retryButtonLabel\":\"أعد المحاولة\",\"solutionViewTitle\":\"قائمةُ الحلول\
